Seguem as sugestões, tópicos:
- o mesmo valor de pagamento para todos os que desempenham a mesma função, visto que existe diferença de clinica para clinica e não deveria de existir,visto que a empresa é a mesma;
-Funções acrescidas como por exemplo, ficar responsável por ensinos dos doentes, responsável por carro de emergência ou responsável pelos acessos vasculares, deviam ser recompensados pelo trabalho acrescido;
- A renumeração de um enfermeiro recém-licenciado ser igual á de um enfermeiro que está na clinica, por exemplo, á 10 anos, deveria existir algum reconhecimento;
-Oferecerem contractos dignos da profissão de enfermagem ,e da importância que os enfermeiros têm para a clinica, e não os 1.100 euros ilíquidos que ofereceram;
-O facto de só existir um reconhecimento da orientação dos novos profissionais quando completarem os 164 turnos,não valoriza o trabalho do orientador visto que muitos dos enfermeiros recém-licenciados não completam o programa de orientação e os orientadores não vêm o tempo e o esforço recompensados, apesar dos novos enfermeiros não terem completado o programa.
É são estas algumas razões/sugestões de que nos leva, a nós enfermeiros, a deixarem a clinica e procurar outra situação profissional,em que nos dão mais valor a nível profissional, nos motivam.
